<html>
<head>
    <meta charset="utf-8">
    <title>Денис Максимов</title>

    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link href="https://fonts.googleapis.com/css2?family=Raleway:wght@300;500&family=Work+Sans:wght@422&display=swap"
          rel="stylesheet">
    <style>
        /* http://meyerweb.com/eric/tools/css/reset/
           v2.0 | 20110126
           License: none (public domain)
        */

        html, body, div, span, applet, object, iframe,
        h1, h2, h3, h4, h5, h6, p, blockquote, pre,
        a, abbr, acronym, address, big, cite, code,
        del, dfn, em, img, ins, kbd, q, s, samp,
        small, strike, strong, sub, sup, tt, var,
        b, u, i, center,
        dl, dt, dd, ol, ul, li,
        fieldset, form, label, legend,
        table, caption, tbody, tfoot, thead, tr, th, td,
        article, aside, canvas, details, embed,
        figure, figcaption, footer, header, hgroup,
        menu, nav, output, ruby, section, summary,
        time, mark, audio, video {
            margin: 0;
            padding: 0;
            border: 0;
            font-size: 100%;
            font: inherit;
            vertical-align: baseline;
        }

        /* HTML5 display-role reset for older browsers */
        article, aside, details, figcaption, figure,
        footer, header, hgroup, menu, nav, section {
            display: block;
        }

        body {
            line-height: 1;
           background-image: -webkit-linear-gradient(bottom, rgba(16, 16, 16, 0.75), rgba(16, 16, 16, 0.25) 80%, rgba(16, 16, 16, 0));
        }

        ol, ul {
            list-style: none;
        }

        blockquote, q {
            quotes: none;
        }

        blockquote:before, blockquote:after,
        q:before, q:after {
            content: '';
            content: none;
        }

        table {
            border-collapse: collapse;
            border-spacing: 0;
        }

    </style>

    <style>
        .pgwSlider {
            width: 100%;
            color: 'black';
        }

        .pgwSlider a {
            display: block;
            text-decoration: none;
            color: #fff
        }

        .pgwSlider .ps-current {
            float: left;
            width: 74%;
            overflow: hidden;
            height: inherit;
            position: relative;
            font-size: 1rem
        }

        .pgwSlider.listOnTheLeft .ps-current {
            float: right
        }

        .pgwSlider .ps-current ul {
            width: 100%
        }

        .pgwSlider .ps-current li {
            width: 100%;
            z-index: 1;
            opacity: 0;
            display: none
        }

        .pgwSlider .ps-current img {
            max-width: 100%;
            min-width: 100%;
            height: auto;
            display: block;
            transition: margin-top 250ms linear;
            object-fit: cover;
            min-height: 100%;
        }

        .pgwSlider .ps-caption {
            position: absolute;
            height: 100px;
            transition: 0.3s;
            background-image: -moz-linear-gradient(bottom, rgba(16, 16, 16, 0.75), rgba(16, 16, 16, 0.25) 80%, rgba(16, 16, 16, 0));
            background-image: -webkit-linear-gradient(bottom, rgba(16, 16, 16, 0.75), rgba(16, 16, 16, 0.25) 80%, rgba(16, 16, 16, 0));
            background-image: -ms-linear-gradient(bottom, rgba(16, 16, 16, 0.75), rgba(16, 16, 16, 0.25) 80%, rgba(16, 16, 16, 0));
            background-image: linear-gradient(bottom, rgba(16, 16, 16, 0.75), rgba(16, 16, 16, 0.25) 80%, rgba(16, 16, 16, 0));
            padding: 2em 2em 0.75em 2em;
            bottom: 0;
            left: 0;
            width: 100%;
            color: rgba(255, 255, 255, 0.5);
            z-index: 1;
            display: none;
            color: #aaa;
            font-size: 1.1em;
            font-family: 'Raleway', sans-serif;
            font-weight: 300;
        }

        .pgwSlider .ps-caption b {
            font-size: 2em;
            color: #fff;
            font-weight: 500;
            line-height: 1.55;
            font-family: 'Raleway', sans-serif;
        }

        ul.pgwSlider, .pgwSlider ul {
            float: right;
            width: 25%;
            padding: 0;
            list-style: none;
            margin: 0
        }

        ul.pgwSlider.listOnTheLeft, .pgwSlider.listOnTheLeft > ul {
            float: left
        }

        ul.pgwSlider > li, .pgwSlider > .ps-list > li {
            height: 50px;
            margin-bottom: 6px;
            overflow: hidden;
            position: relative;
            opacity: .6;
            filter: alpha(opacity=60);
            font-size: .8rem;
            transition: opacity 200ms linear
        }

        ul.pgwSlider > li:last-child, .pgwSlider > ul > li:last-child {
            margin-bottom: 0
        }

        ul.pgwSlider > li span, .pgwSlider > .ps-list > li span {
            display: block;
            width: 100%;
            position: absolute;
            bottom: 0;
            padding: 5px;
            background: rgba(0, 0, 0, 0.7);
            filter: progid:DXImageTransform.Microsoft.gradient(startColorstr=#99000000, endColorstr=#99000000);
            overflow: hidden;
            text-overflow: ellipsis;
            white-space: nowrap
        }

        ul.pgwSlider > li:hover, .pgwSlider > ul > li:hover {
            opacity: 1 !important
        }

        ul.pgwSlider > li img, .pgwSlider > ul > li img {
            width: 100%;
            min-height: 100%;
            display: block;
            transition: margin-top 250ms linear
        }

        .pgwSlider .ps-prevIcon {
            border-color: transparent #fff transparent;
            border-style: solid;
            border-width: 10px 10px 10px 0;
            display: block
        }

        .pgwSlider .ps-nextIcon {
            border-color: transparent #fff transparent;
            border-style: solid;
            border-width: 10px 0 10px 10px;
            display: block
        }

        .pgwSlider .ps-current .ps-prev {
            border-radius: 100%;
            position: absolute;
            padding: 20px 20px 20px 17px;
            left: 10px;
            top: 45%;
            cursor: pointer;
            height: 100px;
            width: 100px;
            fill: #ffffff;
            transform: rotate(180deg);
        }

        .pgwSlider .ps-current .ps-next {
            border-radius: 100%;
            position: absolute;
            padding: 20px 17px 20px 20px;
            right: 10px;
            top: 45%;
            cursor: pointer;
            height: 100px;
            width: 100px;
            fill: #ffffff;
        }

        ul.pgwSlider.wide > li, .pgwSlider.wide > ul > li {
            width: 100% !important
        }

        .pgwSlider.narrow .ps-current {
            margin-bottom: 6px;
            font-size: .8rem
        }

        .pgwSlider.narrow .ps-current img {
            width: 100%;
            min-height: inherit
        }

        .pgwSlider.narrow .ps-current, ul.pgwSlider.narrow, .pgwSlider.narrow > ul {
            width: 100%
        }

        ul.pgwSlider.narrow > li, .pgwSlider.narrow > .ps-list > li {
            float: left;
            min-height: 50px;
            max-height: 70px;
            min-width: 15%;
            font-size: .7rem;
            margin-bottom: 0
        }

        ul.pgwSlider.narrow.listOnTheLeft > li, .pgwSlider.narrow.listOnTheLeft > ul > li {
            float: right
        }

        .pgwSlider.narrow .ps-caption {
            padding: 8px
        }

        .pgwSlider.narrow .ps-current .ps-prev {
            padding: 15px 15px 15px 12px;
            top: 40%
        }

        .pgwSlider.narrow .ps-current .ps-next {
            padding: 15px 12px 15px 15px;
            top: 40%;
        }
    </style>
</head>

<script>
    $(document).ready(function () {
        const pgwSlider =  $('.pgwSlider').pgwSlider({
            autoSlide: false,
            transitionEffect: 'sliding',
            displayList: false,
            displayControls: true,
            adaptiveHeight: true,
            verticalCentering: true,
            maxHeight: window.innerHeight
        });

        document.addEventListener('keydown', function(event) {
            if (event.code === 'ArrowLeft') {
                pgwSlider.previousSlide();
            }

            if (event.code === 'ArrowRight') {
                pgwSlider.nextSlide();
            }
        });
